query:
{
  organization(login: "ballerina-platform") {
    repository(name: "ballerina-lang") {
      pullRequests(states: OPEN, first: 100, labels: "Team/CompilerFE", orderBy: {field: CREATED_AT, direction: ASC}) {
        nodes {
          number
          url
          title
          createdAt
          updatedAt
          isDraft
          mergeable
          reviewDecision
          author {
            login
            url
          }
        }
        pageInfo {
          hasNextPage
          hasPreviousPage
          startCursor
        }
      }
      updatedAt
    }
  }
}
